import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'load' }); // Use 'load' for local files, it's more reliable than 'networkidle'

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The primary goal is to extract as much data as possible.
    // The most efficient way is to access the data directly from the page's JavaScript context.
    // This simulates an attacker reading client-side data stores.

    // Wait for a brief moment to ensure all scripts have run and populated the global scope.
    await page.waitForTimeout(500);

    const exfiltratedData = await page.evaluate(() => {
      // Access global variables defined in the page's <script> tags.
      return {
        profile: window.junProfile || null,
        allProducts: window.allProducts || [],
        reviews: window.junReviews || [],
        orderHistory: window.orderHistory || [],
        wishlist: window.wishlist || [],
        cart: window.cart || [],
        searchHistory: window.searchHistory || [],
        categories: window.categories || {}
      };
    });

    // Also, grab all text content from the page body as another form of bulk data collection.
    const allPageText = await page.locator('body').innerText();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_data_extraction.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_data_extraction.png'));

    // To demonstrate interaction, we can simulate navigating to a sensitive area.
    // Using a different selector strategy: XPath for a link containing specific text.
    const wishListLink = page.locator('//a[contains(text(), "Your Wish List")]').first();
    if (await wishListLink.isVisible()) {
      await wishListLink.click();
      // Wait for mock UI update
      await page.waitForTimeout(500);
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_simulated_navigation_to_wishlist.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_simulated_navigation_to_wishlist.png'));
    }

    // Prepare the final extracted data object for return.
    const extractedDataSummary = {
      profileUsername: exfiltratedData.profile ? exfiltratedData.profile.username : 'N/A',
      totalProductsExtracted: exfiltratedData.allProducts.length,
      totalOrdersExtracted: exfiltratedData.orderHistory.length,
      totalReviewsExtracted: exfiltratedData.reviews.length,
      wishlistItemCount: exfiltratedData.wishlist.length,
      cartItemCount: exfiltratedData.cart.length,
      fullData: exfiltratedData, // Include the complete raw data payload
      allTextContentLength: allPageText.length
    };

    return {
      success: true,
      action: "Successfully simulated bulk data exfiltration by accessing JavaScript variables and scraping all page text.",
      extractedData: extractedDataSummary,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
